import React from 'react';
import './Signup.css';


const signIn = () => {
    return (
           <div className="App">
               <form action="" onSubmit='alert("done")'>
               <h1>Enter Email Add.</h1>
               <input type="email"></input>
               <h1>Enter Password</h1>
               <input type="password"></input>
               <input type="submit"/>
               </form>
           </div>
    );
}

export default signIn;
